import React from 'react';

const ImageList = (props) =>{
    const images = props.images.map((image) => {
        return (
        <li className="item"><img key={image.id} src={image.urls.regular} /></li>
        )
    });
    return (
        <div><ul className="ui list" style={{columnCount: '3'}}>{images}</ul></div>
    )
};
export default ImageList;
